import React from 'react';
import { TextProgress } from './style';

export const Growth = () => (<React.Fregment>
  <TextProgress color='salmon' progress='50%'>growth</TextProgress>
  <TextProgress color='salmon' progress='20%'>esteem</TextProgress>
  <TextProgress color='salmon' progress='30%'>belong</TextProgress>
  <TextProgress color='salmon' progress='35%'>safety</TextProgress>
  <TextProgress color='salmon' progress='40%'>energy</TextProgress>
</React.Fregment>);
